import { AfterViewInit, Directive, ElementRef } from '@angular/core';

/**
 * If input has value then add "has-value" attribute to input element.
 */
@Directive({
  selector: '[tbHasValue]',
  standalone: true,
})
export class HasValueDirective implements AfterViewInit {
  constructor(private readonly elementRef: ElementRef<HTMLInputElement>) {}

  ngAfterViewInit(): void {
    this.elementRef.nativeElement.addEventListener(
      'input',
      (event: InputEvent | any) => {
        console.log('Input Event: ', event.data);
        const data = event.data;
        if (data?.length > 0) {
          this.markAsHasValue();
        } else {
          this.markAsHasNovalue();
        }
      }
    );
  }

  private markAsHasValue() {
    this.elementRef.nativeElement.setAttribute('has-value', 'true');
  }
  private markAsHasNovalue() {
    this.elementRef.nativeElement.setAttribute('has-value', 'false');
  }
}

import { AfterViewInit, Directive, ElementRef, OnDestroy } from '@angular/core';
import { Subscription, debounceTime, fromEvent } from 'rxjs';

/**
 * Change scroll direction to x axis
 */
@Directive({
  selector: '[tbScrollX]',
  standalone: true,
})
export class ScrollDirectionDirective implements AfterViewInit, OnDestroy {
  subscription?: Subscription;

  constructor(private readonly elementRef: ElementRef<HTMLDivElement>) {}
  ngOnDestroy(): void {
    this.subscription?.unsubscribe();
  }

  ngAfterViewInit(): void {
    this.elementRef.nativeElement.onwheel = (event) => {
      if (!event.shiftKey) {
        event.preventDefault();
      }
    };
    this.subscription = fromEvent<WheelEvent>(
      this.elementRef.nativeElement,
      'wheel'
    )
      .pipe(debounceTime(100))
      .subscribe((e) => {
        if (!e.shiftKey)
          this.elementRef.nativeElement.scrollBy({
            left: e.deltaY * 2,
            behavior: 'smooth',
          });
      });
  }
}

import {
  AfterViewInit,
  ComponentRef,
  Directive,
  ElementRef,
  Input,
} from '@angular/core';

@Directive({ selector: '[tbSetAttribute]', standalone: true })
export class SetAttributeDirective implements AfterViewInit {
  @Input() tbSetAttribute?: Record<string, any>;
  constructor(public readonly elementRef: ElementRef<HTMLElement>) {}

  ngAfterViewInit(): void {
    if (this.tbSetAttribute) {
      const entries = Object.entries(this.tbSetAttribute);
      for (const [key, value] of entries) {
        if (key.startsWith('__')) {
          return;
        }
        this.elementRef.nativeElement.setAttribute(key, value);
      }
    }
  }
}

